import React, { useState } from 'react';
import axios from 'axios';
import { Form, Input, Button } from '../criarCliente/criarClienteStyle';
import api from '../../axios/axios';

const ClienteForm = () => {
  const [cliente, setCliente] = useState({
    chaveDeAcesso: '',
    name: '',
    cpf: '',
    email: '',
    profissao: '',
    sexo: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCliente({
      ...cliente,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log("Formulário enviado:", cliente);
    try {

      const response = await axios.post('https://projetoinicialusr.onrender.com/v1/users/criar-cliente', cliente, {
        headers: {
          'Content-Type': 'application/json'
        }
      });
      console.log('Cliente criado com sucesso:', response.data);
      alert('Cliente criado com sucesso!');
    } catch (error) {
      console.error('Erro ao criar cliente:', error.response ? error.response.data : error.message);
      alert('Erro ao criar cliente: ' + (error.response ? error.response.data.message : error.message));
    }
  };

  return (
    <Form onSubmit={handleSubmit}>
      <label>
        Chave de Acesso:
        <Input type="text" name="chaveDeAcesso" value={cliente.chaveDeAcesso} onChange={handleChange} />
      </label>
      <label>
        Nome:
        <Input type="text" name="name" value={cliente.name} onChange={handleChange} />
      </label>
      <label>
        CPF:
        <Input type="text" name="cpf" value={cliente.cpf} onChange={handleChange} />
      </label>
      <label>
        Email:
        <Input type="email" name="email" value={cliente.email} onChange={handleChange} />
      </label>
      <label>
        Profissão:
        <Input type="text" name="profissao" value={cliente.profissao} onChange={handleChange} />
      </label>
      <label>
        Sexo:
        <Input type="text" name="sexo" value={cliente.sexo} onChange={handleChange} />
      </label>
      <Button type="submit">Cadastrar</Button>
    </Form>
  );
};

export default ClienteForm;
